// Dashboard.js
import React from 'react';

const Dashboard = () => {
  return (
    <div>
      <h2>Data Dashboard</h2>
      <div style={styles.container}>
        <div style={styles.section}>
          {/* Placeholder for a chart component */}
          <h3>Chart Section</h3>
          <div style={styles.chart}></div>
        </div>
        <div style={styles.section}>
          {/* Placeholder for a table component */}
          <h3>Table Section</h3>
          <div style={styles.table}></div>
        </div>
        <div style={styles.section}>
          {/* Placeholder for a summary component */}
          <h3>Summary Section</h3>
          <div style={styles.summary}></div>
        </div>
      </div>
    </div>
  );
};

const styles = {
  container: {
    display: 'flex',
    justifyContent: 'space-between',
    marginTop: '20px',
  },
  section: {
    flex: 1,
    padding: '20px',
    border: '1px solid #ccc',
    borderRadius: '4px',
    marginBottom: '20px',
  },
  chart: {
    width: '100%',
    height: '300px',
    backgroundColor: '#f0f0f0',
  },
  table: {
    width: '100%',
    height: '300px',
    backgroundColor: '#f9f9f9',
  },
  summary: {
    width: '100%',
    height: '100px',
    backgroundColor: '#e0e0e0',
  },
};

export default Dashboard;
